const settings = {
    dots: true,
    infinite: true,
    backgroundColor: 'rgba(255, 255, 255, 0.8)',
    outline: '0',
    dotsClass: "slick-dots slick-thumb",
    speed: 2000,
    slidesToShow: 3,
    slidesToScroll: 1,
    autoplay: false,
    arrows: false,
    autoplaySpeed: 1000,
      appendDots: dots => {
        return <ul style={{ margin: "10px" }}>{dots}</ul>;
      },


    responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
  }; 

  export default settings
